import React from 'react';
import Navigator from './Navigator';
import CourseList from "./CourseList";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

export default function Admin(){
    return <div>
        <Navigator />
        <Row>
            <Col lg={2}>
                <CourseList />
            </Col>
        </Row>

    </div>;
}
